import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class TuitionRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="tuitionResults">
				<div className="tuition_type">{this.props.tuition_type}</div>
				<div className="tuition_fees_ft">{this.props.tuition_fees_ft}</div>
                <div className="url_fin_aid">{this.props.url_fin_aid}</div>
			</div>
		);
	}
}
